import random from "./random";
export default ()=>{
	const alphabet=["a", "b", "c", "d", "e", "f", "g", "h", "i", "j", "k", "l", "m", "n", "o", "p", "q", "r", "s", "t", "u", "v", "w", "x", "y", "z"];
	let str="";
	for (let i=0;i<20;i++) {
		if (random(0,1)===0) str+=random(0,9);
		else str+=alphabet[random(0,alphabet.length-1)]
	}
	return str;
}
